import MenuList from "./menu-list";

export default function MenuItem({item}){
    return(
        <li className="">
            <p>{item.label}</p>
            {
                item && item.children && item.children.length > 0  ?
                <MenuList list={item.children}/>
                :null
            }
        </li>
    )
}
